import React from 'react';
function ToDoItem(props) {
  let item = props.item.items;

  return (
    <div className="border border-success p-2 text-center">
      <h1>{props.item.todo_name}</h1>
      {item.map((val, i) => {
        return (
          <div key={i} className="d-flex justify-content-between border border-danger p-2 m-2 col-lg-6">
            <div>
              <input id={val.id} type="checkbox" name="isDone" className="mr-1" checked={val.completed} />
              <label htmlFor={val.id}>{val.item_name}</label>
            </div>

            <div>{val.created_at}</div>
          </div>)

      })}
    </div>
  )
}

export default ToDoItem
